import { Container, Grid, Typography } from '@material-ui/core'

import styles from './Calculator.module.scss'

function Calculator () {
    return (
        <div className={styles.calculator}>
            <Typography variant="h3">Calculadora</Typography>
        </div>
    )
}

export default Calculator
